import React from 'react';

import {
  BrowserRouter,
  Route,
  Routes,
} from 'react-router-dom';

import {
  createMuiTheme,
  makeStyles,
  ThemeProvider,
  Paper
} from '@material-ui/core';
import { purple } from '@mui/material/colors';

import Auth from './Components/auth/Auth';
import Calendar from './Components/Calendar';
import Layout from './Components/Layout';
import Create from './Components/pages/Create';
import Notes from './Components/pages/Notes';

const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#fefefe'
    },
    secondary: purple,
    type: 'dark'
  },

  typography: {
    fontFamily: 'Quicksand',

    fontWightLight: 400,

    fontWightRegular: 500,

    fontWightMedium: 600,

    fontWightBold: 700
  },
});


const useStyles = makeStyles({
  page: 
  {
    background: '#f9f9f9',
    width: '100%' 
  },

  field: {
    marginTop: 20,
    marginBotton: 20,
    display: 'block'
  }
});



const App = () => 
{
  const classes = useStyles();


  return (
    <div>
     <ThemeProvider theme={theme} >
        <BrowserRouter>
        <Paper style={{height: "100vh"}}>
        <Layout  theme={theme}>
          <Routes>
                <Route path="/" element={<Auth/>} theme={theme}/>
                <Route path="/Create" element={<Create/>} theme={theme}/> //Home
                <Route path="/Notes" element={<Notes/>} theme={theme}/>
                <Route path="/Calendar" element={<Calendar/>} theme={theme}/>
          </Routes>
        </Layout>
        </Paper>
        </BrowserRouter>
    </ThemeProvider>   
    </div>
  )
}

export default App;
